import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Diet Planner</h1>
      </header>
      <Input type="text" className="" placeholder="Diet Planner" />
    </div>
  );
}

export default App;
